import "./App.css";
import Esquerda from "./componentes/esquerda/esquerda";
import Topo from "./componentes/topo/topo";
import Meio from "./componentes/meio/meio";
import { useState } from "react";
import { loadJson } from "./handlers/loadJson";

function App() {
  const [conteudoJson, setConteudoJson] = useState(null);

  const buscarJson = async (nomeArquivo) => {
    const dados = await loadJson(nomeArquivo);
    setConteudoJson(dados);
  };

  return (
    <div className="pagina">
      <Esquerda />
      <div className="area-direita">
        <Topo />
        <Meio />
      </div>
    </div>
  );
}

export default App;
